function changeColor(time, color, callback, reject) {
    let randomNum = Math.floor(Math.random() * 10);

    if (true) {
        setTimeout(() => {
            body.style.backgroundColor = color;
            callback();
        }, time);
    } else {
        reject();
        // console.log("your request was rejected â˜¹");
    }
}
